document.addEventListener("DOMContentLoaded",function(){let e=document.querySelectorAll(".product");for(let t of e){let r=t.querySelector(".woocommerce-loop-product__title"),o=t.querySelector(".star-rating");if(r&&!o){let l=document.createElement("div");l.classList.add("star-rating"),r.parentNode.insertBefore(l,r.nextSibling)}}});